import React, {Component} from 'react';

class Article extends Component {
  render(){
    let articles = [];
    let datas = this.props.data;

    datas.forEach(data =>
      articles.push(
        <h1 key={data.id}>{data.title}</h1>)
    );
    return(
      <article>
        {articles}
      </article>
    )
  }
}

export default Article;
